import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import logo from '../../images/logo.png';
import Navbar from 'react-bootstrap/Navbar';
import { Nav } from 'react-bootstrap';

function NavebarPage() {
  return (
    
      <Navbar className='sticky-top' bg="dark" variant='dark' expand='sm'>
      <Container>
        <Navbar.Brand ><img src={logo} className='logo'/></Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          
            <Form.Control
              type="search"
              placeholder="Search"
              className="me-2 w-100 taxt-center"
              aria-label="Search"
            />
            <Nav className="me.auto">
                <Nav.Link
                className='nav-text d-flex mt.3 justify-contet'
                style={{color:"white"}}>
                    <img src={cart} className='login-img' alt='sfvs'/>
                    <p style={{color:"white"}}>العر</p>
                </Nav.Link>
            </Nav>
            <Button >Search</Button>
          
        </Navbar.Collapse>
      </Container>
    </Navbar>
  
  );
}

export default NavebarPage;
